import { fetchIndustryTop3Articles, fetchIndustryTop10Companies } from '../api/industry';
import { useNavigate } from 'react-router-dom';

// 산업 agent 분석 실행 함수
export function goToIndustryAgent(sector, endDate) {
  const navigate = useNavigate();

  // 페이지 이동: 쿼리 파라미터로 sector, endDate 전달
  navigate(`/industry-agent?sector=${encodeURIComponent(sector)}&endDate=${encodeURIComponent(endDate)}`);
}
